    final ListPopulation population = new ListPopulation(10) {
        public Population nextGeneration() {
            // not important
            return null;
        }
    };

    population.addChromosomes(chromosomes);

    final Iterator<Chromosome> iter = population.iterator();
    while (iter.hasNext()) {
        iter.next();
